(22688, 'widget_custom_html', 'a:3:{i:2;a:2:{s:5:\"title\";s:0:\"\";s:7:\"content\";s:445:\"<h2>\r\n	Return Policies &amp; Resizing\r\n</h2>\r\n\r\n<ul>\r\n	<li>\r\n		If you have a problem with anything for any reason, please message us.  We understand things can go wrong, and want to make sure you are completely happy with your new jewelry! However, we <strong>cannot resize rings with stones.</strong>\r\n	</li>\r\n\r\n	<li>\r\n		Sales are final; unless there is a problem with your order, we cannot offer returns for unwanted pieces.\r\n	</li>\r\n</ul>\r\n\r\n\";}i:3;a:2:{s:5:\"title\";s:0:\"\";s:7:\"content\";s:441:\"<h2>\r\n	Return Policies &amp; Resizing\r\n</h2>\r\n\r\n<ul>\r\n	<li>\r\n		If you have a problem with anything for any reason, please message us.  We understand things can go wrong, and want to make sure you are completely happy with your new jewelry! However, we <strong>cannot resize rings with stones.</strong>\r\n	</li>\r\n\r\n	<li>\r\n		Sales are final; unless there is a problem with your order, we cannot offer returns for unwanted pieces.\r\n	</li>\r\n</ul>\";}s:12:\"_multiwidget\";i:1;}', 'yes'),
