(205, 1, '2016-05-26 22:25:33', '2016-05-27 02:25:33', '<p style=\"text-align: center;\"><strong>On June 4th, we will be at one of our favorite places for the <a href=\"https://www.facebook.com/events/171207253252885/\">Red Oak Lavender Farm Festival</a> in Dahlonega! Come by to smell the the fresh lavender, cut a bouquet, and learn about the bees! It\'s a lot of fun, and a great way to enjoy the day outside.</strong></p>', 'Events', '', 'inherit', 'closed', 'closed', '', '106-revision-v1', '', '', '2016-05-26 22:25:33', '2016-05-27 02:25:33', '', 106, 'http://hammerheadsilver.com/index.php/2016/05/26/106-revision-v1/', 0, 'revision', '', 0),
