(385, 1, '2018-10-09 21:24:28', '2018-10-10 01:24:28', 'On October 26th, we will be at the 7th annual <a href=\"https://www.facebook.com/events/952953331563223/\">Buy Your Own Boulderfield</a> at <a href=\"https://www.seclimbers.com/2018/07/26/buy-your-own-boulderfield/\">The Crash Pad at </a><span class=\"LrzXr\">29 Johnson St in Chattanooga, TN! The event starts at 7 and will host an auction to help raise more money for more public access climbing areas. We have donated very special pieces to help raise money, and will have a booth to shop from as well! </span>\n\nIf you love to climb outside or want to protect beautiful land from development, don\'t miss it! We', 'Events', '', 'inherit', 'closed', 'closed', '', '106-autosave-v1', '', '', '2018-10-09 21:24:28', '2018-10-10 01:24:28', '', 106, 'http://hammerheadsilver.com/index.php/2018/06/05/106-autosave-v1/', 0, 'revision', '', 0),
