(30, 1, '2016-04-02 05:10:03', '2016-04-02 05:10:03', '<strong>HammerHead Silver is a home grown operation that started in a basement in north georgia, and is run by Hillary and Dustin. We satisfy our passions to learn and challenge ourselves by creating one of a kind handmade silver jewelry pieces.  Our creative desires guide and develop our individual styles, which often work together as we learn together.</strong>', 'About', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2016-04-02 05:10:03', '2016-04-02 05:10:03', '', 18, 'http://hammerheadsilver.com/index.php/2016/04/02/18-revision-v1/', 0, 'revision', '', 0),
