(35, 1, '2016-04-02 05:34:42', '2016-04-02 05:34:42', '<strong>HammerHead Silver is a home grown operation that started in a basement in north georgia, and is run by Hillary and Dustin. We satisfy our passions to learn and challenge ourselves by creating one of a kind handmade silver jewelry pieces.  Our creative desires guide and develop our individual styles, which often work together as we learn together. Dustin is influenced by fine jewelry techniques, whereas Hillary is more influenced by traditional Native American styles. We contribute a diverse collection of jewelry to our local area and other growing communities.</strong>', 'About', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2016-04-02 05:34:42', '2016-04-02 05:34:42', '', 18, 'http://hammerheadsilver.com/index.php/2016/04/02/18-revision-v1/', 0, 'revision', '', 0),
