(111, 1, '2016-04-14 19:43:57', '2016-04-14 23:43:57', 'HammerHead Silver is a home grown operation that started in a basement in north georgia, and is run by Hillary and Dustin. We satisfy our passions to learn and challenge ourselves by creating one of a kind handmade silver jewelry pieces.  Our creative desires guide and develop our individual styles, which often work together as we learn together. Dustin is influenced by fine jewelry techniques, whereas Hillary is more influenced by traditional Native American styles. We contribute a diverse collection of jewelry to our local area and other growing communities.', 'About', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2016-04-14 19:43:57', '2016-04-14 23:43:57', '', 18, 'http://hammerheadsilver.com/index.php/2016/04/14/18-revision-v1/', 0, 'revision', '', 0),
(106, 1, '2016-04-14 19:42:42', '2016-04-14 23:42:42', 'On October 26th, we will be at the 7th annual <a href=\"https://www.facebook.com/events/952953331563223/\">Buy Your Own Boulderfield</a> at <a href=\"https://www.seclimbers.com/2018/07/26/buy-your-own-boulderfield/\">The Crash Pad at </a><span class=\"LrzXr\">29 Johnson St in Chattanooga, TN! The event starts at 7 and will host an auction to help raise more money for more public access climbing areas. We have donated very special pieces to help raise money, and will have a booth to shop from as well! </span>\r\n\r\nIf you love to climb outside or want to protect beautiful land from development, don\'t miss it! We\'ll see you there :}', 'Events', '', 'publish', 'closed', 'closed', '', 'events', '', '', '2018-10-09 21:24:33', '2018-10-10 01:24:33', '', 0, 'http://hammerheadsilver.com/?page_id=106', 0, 'page', '', 0),
