(128, 1, '2016-04-24 22:22:45', '2016-04-25 02:22:45', '<p style=\"text-align: center;\">HammerHead Silver is a home grown operation that started in a basement in north georgia, and is run by Hillary and Dustin. We satisfy our passions to learn and challenge ourselves by creating one of a kind handmade silver jewelry pieces.  Our creative desires guide and develop our individual styles, which often work together as we learn together. Dustin is influenced by fine jewelry techniques, whereas Hillary is more influenced by traditional Native American styles. We contribute a diverse collection of jewelry to our local area and other growing communities.</p>', 'About', '', 'inherit', 'closed', 'closed', '', '18-revision-v1', '', '', '2016-04-24 22:22:45', '2016-04-25 02:22:45', '', 18, 'http://hammerheadsilver.com/index.php/2016/04/24/18-revision-v1/', 0, 'revision', '', 0),
