(244, 1, '2016-07-16 01:30:52', '2016-07-16 05:30:52', 'If you have a problem with anything for any reason, please message us.  We understand things can go wrong, and want to make sure you are completely happy with your new jewelry. However, we cannot resize rings with stones.\r\n\r\nWe are two people creating one of a kind jewelry, and unfortunately cannot afford to offer returns for unwanted pieces.\r\n\r\nWe are traveling around the U.S. and sometimes stay in places without internet access.  We check emails as often as possible, so if you are waiting to hear back, please be understanding of this situation!', 'Policies', '', 'publish', 'closed', 'closed', '', 'policies', '', '', '2018-05-14 20:01:31', '2018-05-15 00:01:31', '', 0, 'http://hammerheadsilver.com/?page_id=244', 0, 'page', '', 0),
