(247, 1, '2016-07-16 17:57:50', '2016-07-16 21:57:50', '<p style=\"text-align: center;\"><strong>We will be at the <a href=\"http://indiesouthfair.com/midsummer/\">Midsummer Night\'s Market</a> on July 22nd from 5-10pm at <a href=\"http://www.creaturecomfortsbeer.com\">Creature Comforts</a> in Athens! Come drink great tasty beer, and see us and all the other great makers and vintage merchants!</strong></p>', 'Events', '', 'inherit', 'closed', 'closed', '', '106-revision-v1', '', '', '2016-07-16 17:57:50', '2016-07-16 21:57:50', '', 106, 'http://hammerheadsilver.com/index.php/2016/07/16/106-revision-v1/', 0, 'revision', '', 0),
