(545, 1, '2018-07-22 17:52:06', '2018-07-22 21:52:06', '', 'Bubble Turquoise Pendant Earrings', 'Super fun and unique earrings made with bright blue Kingman turquoise surrounded by sterling silver balls hanging on slim silver chain\r\n\r\n3.25\" in total length\r\n\r\nHandmade by Hillary', 'inherit', 'closed', 'closed', '', '481-autosave-v1', '', '', '2018-07-22 17:52:06', '2018-07-22 21:52:06', '', 481, 'http://hammerheadsilver.com/index.php/2018/07/22/481-autosave-v1/', 0, 'revision', '', 0),
